    false,nt"url": null,nt"notes": "The Digital Flood Insurance Rate Map (DFIRM)
    Database depicts flood risk information and supporting data used to develop the
    risk data. The primary risk classifications used are the 1-percent-annual-chance
    flood event and areas of minimal flood risk. The DFIRM Database is derived from
    Flood Insurance Studies (FISs), previously published Flood Insurance Rate Maps (FIRMs),
    flood hazard analyses performed in support of the FISs and FIRMs, and new mapping
    data, where available. The FISs and FIRMs are published by the Federal Emergency
    Management Agency (FEMA). The file is georeferenced to earth's surface using the
    Nebraska State Plane Feet coordinate system. The specifications for the horizontal
    control of DFIRM data files are consistent with those required for mapping at a
    scale of 1:6,000.",nt"owner_org": "ae816746-a815-4a3f-805d-2b51b561c626",nt"extras":
