    "["Use Constraints: The purpose of this information is to be reviewed by FEMA
    for publication as a countywide floodplain study. Local governments may utilize
    this data as best available information for the purpose of floodplain management
    in flood zones not shown on effective Flood Insurance Rate Maps. Financial support
    to prepare this publication was provided by the Federal Emergency Management Agency
    through a cooperative agreement with the {name of grantee}. The information contained
    in this publication has not been reviewed by FEMA for technical accuracy, and does
    not necessarily reflect the view of the Federal Emergency Management Agency. The
    hardcopy FIRM and DFIRM and the accompanying FISs are the official designation of
    SFHAs and Base Flood Elevations (BFEs) for the NFIP. For the purposes of the NFIP,
    changes to the flood risk information published by FEMA may only be performed by
    FEMA and through the mechanisms established in the NFIP regulations (44 CFR Parts
    59-78). These digital data are produced in conjunction with the hardcopy FIRMs and
    generally match the hardcopy map exactly. However the hardcopy flood maps and flood
    profiles are the authoritative documents for the NFIP. Acknowledgement of FEMA would
    be appreciated in products derived from these data.", "Access Constraints: None"]"nt},nt{ntt"key":
